-- Create date: 2013-03-24
-- Description:	Procedure to insert or update Milestone Value table
-- =============================================
CREATE PROCEDURE [Core].[uspModMilestoneValue]
	-- Add the parameters for the stored procedure here
	@CRUD nvarchar(5),   -- C=Create,R=Read,U=Update,D=Delete
	@MilestoneValues_ID int ,
	@Milestone_ID as [int]  ,
	@BaselineLabel as [varchar](50)  ,
	@BaselineValue as [decimal](20, 5) ,
	@BaselineString as [varchar](max) ,
	@BaselineDate as [date] ,
	@TargetLabel as [varchar](50)  ,
	@TargetValue as [decimal](20, 5) ,
	@TargetValueString as [varchar](max) ,
	@TargetDate as [date] ,
	@ActualLabel as [varchar](50)  ,
	@ActualValue as [decimal](20, 5) ,
	@ActualValueString as [varchar](max) ,
	@ActualDate as [date] ,
	@BusinessKey as [varchar](max) ,
	@Notes as [varchar](max) ,
	@VerifiedActualValue as [decimal](20, 5) ,
	@VerifiedActualNotes as [varchar](max) ,
	@DataVersion_ID as [int]  ,
	@Location_ID as [int]  ,
	@MilestoneStatusPercent as [decimal](18, 2) ,
	@ReportPeriodID as [int]  ,
	@Title as [varchar](255) ,
	@ModifiedDate as [datetime] ,
	@Organization_ID as [int] ,
	@Username as [varchar](255) 

AS

/*Sub Outputs*/ SELECT SOP.BusinessKey + ' : ' + SOP.ShortName + '...' AS Title, 
                         '/' + 'Outcome1' + '/Dashboards/Template%20Pages/Indicator%20Details%20Page.aspx?qsIndCode=[Output].[Output].%26[' + CONVERT(nvarchar(20), 
                         op.Output_ID) + ']' AS Link, 1000 + op.Output_ID AS Parent, 2000 + sop.SubOutput_ID AS ID
/*,op.* */ FROM app.output op INNER JOIN
                         app.outcome oc ON op.OutcomeID = oc.OutcomeID INNER JOIN
                         app.SubOutput SOP ON op.Output_ID = SOP.Output_ID
/*Left outer Join app.Indicator opi on opi.Output_ID=op.Output_ID*/ WHERE oc.code = 'Outcome 1'
UNION ALL
/*Inicators*/ SELECT op.BusinessKey + ' : Indicator ' + CONVERT(Nvarchar(20), Row_Number() OVER (ORDER BY opi.Indicatorid)) + ' ' + opi.ShortName + '...' AS Title, 
'/' + 'Outcome1' + '/Dashboards/Template%20Pages/Indicator%20Details%20Page.aspx?qsIndCode=[Output].[Output].%26[' + CONVERT(nvarchar(20), opi.IndicatorID) 
+ ']' AS Link, 1000 + op.Output_ID AS Parent, 4000 + opi.IndicatorID AS ID
/*,op.* */ FROM app.output op INNER JOIN
                         app.outcome oc ON op.OutcomeID = oc.OutcomeID /*inner join app.SubOutput SOP on op.Output_ID=SOP.Output_ID*/ INNER JOIN
                         app.Indicator opi ON opi.Output_ID = op.Output_ID
/*Left outer Join app.Indicator opi on opi.Output_ID=op.Output_ID*/ WHERE oc.code = 'Outcome 1'
/*Defaults*/ UNION ALL
SELECT        [Title], [Link], [Parent], [ID]
/*,[Active]*/ FROM [dbo].[Outcome1MenuGroup]
WHERE        Parent = 10000

/*Inicators*/ SELECT SOP.BusinessKey + ' : Indicator ' + CONVERT(Nvarchar(20), Row_Number() OVER (ORDER BY sopi.Indicatorid)) + ' ' + sopi.ShortName + '...' AS Title, 
'/' + 'Outcome1' + '/Dashboards/Template%20Pages/Indicator%20Details%20Page.aspx?qsIndCode=[Output].[Output].%26[' + CONVERT(nvarchar(20), sopi.IndicatorID) 
+ ']' AS Link, 2000 + SOP.Output_ID AS Parent, 5000 + sopi.IndicatorID AS ID
/*,op.* */ FROM app.output op INNER JOIN
                         app.outcome oc ON op.OutcomeID = oc.OutcomeID INNER JOIN
                         app.SubOutput SOP ON op.Output_ID = SOP.Output_ID INNER JOIN
                         app.Indicator sopi ON sopi.SubOutput_ID = sop.SubOutput_ID
/*Left outer Join app.Indicator opi on opi.Output_ID=op.Output_ID*/ WHERE oc.code = 'Outcome 1'
